import { useState } from 'react';
import { useNavigate, useLocation, Link } from 'react-router-dom';
import { login, setToken } from '../api';
import ThemeToggle from '../components/ThemeToggle';
import './GamePage.css'; // for button styles

const Login = () => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState(null);
  const navigate = useNavigate();
  const location = useLocation();
  const from = location.state?.from?.pathname || '/';

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await login({ username, password });
      setToken(res.data.token);
      navigate(from, { replace: true });
    } catch (e) {
      setError(e.response?.data?.error || 'Login failed');
    }
  };

  return (
    <div style={{
      minHeight: '100vh',
      background: 'linear-gradient(135deg, #232526 0%, #414345 100%)',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      position: 'relative',
      overflow: 'hidden',
    }}>
      {/* Poker chips/cards background accent (optional, simple SVG) */}
      <div style={{
        position: 'absolute',
        top: 0,
        left: 0,
        width: '100%',
        height: '100%',
        opacity: 0.08,
        zIndex: 0,
        pointerEvents: 'none',
        background: 'url("data:image/svg+xml,%3Csvg width=\'200\' height=\'200\' viewBox=\'0 0 200 200\' fill=\'none\' xmlns=\'http://www.w3.org/2000/svg\'%3E%3Ccircle cx=\'100\' cy=\'100\' r=\'80\' stroke=\'%23ff6b3d\' stroke-width=\'12\' fill=\'none\'/%3E%3Crect x=\'30\' y=\'140\' width=\'40\' height=\'20\' rx=\'6\' fill=\'%23fff\' fill-opacity=\'0.7\'/%3E%3C/svg%3E") repeat',
      }} />
      <div style={{
        zIndex: 1,
        background: 'rgba(34, 40, 49, 0.97)',
        borderRadius: '18px',
        boxShadow: '0 8px 32px rgba(0,0,0,0.18)',
        padding: '2.5rem 2.5rem 2rem 2.5rem',
        maxWidth: 420,
        width: '100%',
        textAlign: 'center',
        position: 'relative',
      }}>
        {/* Logo */}
        <div style={{ marginBottom: '1.2rem' }}>
          <span style={{
            display: 'inline-block',
            background: 'radial-gradient(circle at 60% 40%, #ff6b3d 60%, #fff 100%)',
            borderRadius: '50%',
            width: 64,
            height: 64,
            boxShadow: '0 2px 8px rgba(255,107,61,0.18)',
            fontSize: 40,
            lineHeight: '64px',
            color: '#fff',
            fontWeight: 900,
            letterSpacing: '-2px',
            userSelect: 'none',
          }}>🃏</span>
        </div>
        <h1 style={{
          color: '#fff',
          fontWeight: 800,
          fontSize: '2.2rem',
          marginBottom: '0.5rem',
          letterSpacing: '-1px',
        }}>ChipMate</h1>
        <div style={{
          color: '#ffbfa3',
          fontSize: '1.1rem',
          marginBottom: '1.5rem',
          fontWeight: 500,
        }}>
          Welcome back! Log in to track your poker debts.
        </div>
        {error && (
          <div style={{
            backgroundColor: '#ffebee',
            color: '#c62828',
            padding: '0.75rem',
            borderRadius: '4px',
            marginBottom: '1rem',
            fontSize: '0.875rem'
          }}>
            ⚠️ {error}
          </div>
        )}
        <form onSubmit={handleSubmit} style={{ marginBottom: '1.2rem' }}>
          <div className="form-group">
            <input
              type="text"
              placeholder="Username"
              value={username}
              onChange={(e) => setUsername(e.target.value)}
              autoComplete="username"
              required
              className="dialog-input"
              style={{ marginBottom: 16, width: '100%' }}
            />
          </div>
          <div className="form-group">
            <input
              type="password"
              placeholder="Password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              autoComplete="current-password"
              required
              className="dialog-input"
              style={{ marginBottom: 16, width: '100%' }}
            />
          </div>
          <button
            type="submit"
            className="settle-button"
            style={{ width: '100%', fontSize: '1.1rem', padding: '0.8rem 0', marginBottom: 8 }}
          >
            Login
          </button>
        </form>
        <p style={{ color: '#fff', fontSize: '1rem', marginBottom: 0 }}>
          No account?{' '}
          <span
            style={{ color: '#ff6b3d', cursor: 'pointer', fontWeight: 600 }}
            onClick={() => navigate('/register')}
          >
            Register
          </span>
        </p>
        <div style={{ position: 'absolute', top: 18, right: 18 }}>
          <ThemeToggle />
        </div>
      </div>
    </div>
  );
};

export default Login;
